package com.itwill.dto;

public class Family {
	private String famNo;
	private String famEmpNo;
	private String famRelation;
	private String famName;
	private String famPhone;
	private String famLive;

	
	public Family() {
		// TODO Auto-generated constructor stub
	}


	public String getFamNo() {
		return famNo;
	}


	public void setFamNo(String famNo) {
		this.famNo = famNo;
	}


	public String getFamEmpNo() {
		return famEmpNo;
	}


	public void setFamEmpNo(String famEmpNo) {
		this.famEmpNo = famEmpNo;
	}


	public String getFamRelation() {
		return famRelation;
	}


	public void setFamRelation(String famRelation) {
		this.famRelation = famRelation;
	}


	public String getFamName() {
		return famName;
	}


	public void setFamName(String famName) {
		this.famName = famName;
	}


	public String getFamPhone() {
		return famPhone;
	}


	public void setFamPhone(String famPhone) {
		this.famPhone = famPhone;
	}


	public String getFamLive() {
		return famLive;
	}


	public void setFamLive(String famLive) {
		this.famLive = famLive;
	}
	

}
